function User({ user }) {
    return <li>{user.name}</li>;
}
function List({ user }) {
    return (
        <tr>
            <td>{user.name}</td>
            <td>{user.email}</td>
            <td>{user.phoneNumber}</td>
        </tr >
    );
}

export default {
    User,
    List
}
